import React, { Component } from "react";

class NavBar extends Component {
  render() {
    return (
      <nav>
        <div className="nav-wrapper">
          <a href="#" className="brand-logo">
            Logo
          </a>
        </div>
      </nav>
    );
  }
}

export default NavBar;
